import React from "react";
import {useState} from 'react'

import Login from './Login'

import {
    BrowserRouter as Router,
    Routes,
    Route,
    Navigate,
    Link
} from "react-router-dom";


export default function Home(){

    return(
        <>   
         <Router>
            <Link to="/">Home</Link>
            <Link to="/login">Login</Link>
            <Link to="/search">Search</Link>
                <Routes>
                
                     <Route
                        exact
                        path="/login"
                        element={<Login />}
                    />
                    <Route
                        exact
                        path="/search"
                        element={<Search />}
                    />  
                    </Routes>
            </Router>
        </>

    );
};
